import React, { useState } from 'react';
import { useParams } from 'react-router-dom';

function ConfigurePerson() {
  const { name: initialName, surname: initialSurname, s_location: initialLocation, uuid: initialUuid } = useParams();

  const [name, setName] = useState(initialName);
  const [surname, setSurname] = useState(initialSurname);
  const [s_location, setLocation] = useState(initialLocation);
  const [uuid, setUUID] = useState(initialUuid);

  const handleSubmit = (event) => {
    event.preventDefault();
    // Submit the form data
  };

  return (
    <div className="main-background">
      <div className="settings-container">
        <div className="settings-form">
          <h1>UserSettings</h1>
          <form onSubmit={handleSubmit}>
            <div className="input-group">
              <div className="column-group">
                <label>Name:</label>
                <input type="text" value={name} onChange={(e) => setName(e.target.value)} />
              </div>
              <div className="column-group">
                <label>Surname:</label>
                <input type="text" value={surname} onChange={(e) => setSurname(e.target.value)} />
              </div>
            </div>
            <div className="input-group">
              <div className="column-group">
                <label>Current house:</label>
                <input type="text" value={s_location} onChange={(e) => setLocation(e.target.value)} />
              </div>
              <div className="column-group">
                <label>Pendant UUID:</label>
                <input type="text" value={uuid} onChange={(e) => setUUID(e.target.value)} />
              </div>
            </div>
            <button type="submit">Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
}

export default ConfigurePerson;
